import React, { useState } from 'react';
import './MedicineSearch.css';

const medicinesList = [
    { id: 1, name: 'Paracetamol', price: 10, image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Ibuprofen', price: 15, image: 'data:image/jpeg;base64,' },
    { id: 3, name: 'Amoxicillin', price: 20, image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Cetirizine', price: 12, image: 'data:image/jpeg;base64,' },
    { id: 5, name: 'Omeprazole', price: 25, image: 'data:image/png;base64,' },
    { id: 6, name: 'Metformin', price: 30, image: 'data:image/jpeg;base64,' },
    { id: 7, name: 'Atorvastatin', price: 28, image: 'data:image/jpeg;base64,' },
    { id: 8, name: 'Azithromycin', price: 18, image: 'https://5.imimg.com/data5/SELLER/Default/2023/6/319647623/NW/AA/UG/135658020/azithromycin-tablet-i-p-500mg-500x500.jpg' },
    { id: 9, name: 'Lisinopril', price: 35, image: 'data:image/jpeg;base64,' },
    { id: 10, name: 'Levothyroxine', price: 22, image: 'data:image/jpeg;base64,' },
    { id: 11, name: 'Aspirin', price: 5, image: 'data:image/jpeg;base64,' },
    { id: 12, name: 'Ciprofloxacin', price: 17, image: 'data:image/jpeg;base64,' },
    { id: 13, name: 'Furosemide', price: 26, image: 'data:image/jpeg;base64,' },
    { id: 14, name: 'Alprazolam', price: 40, image: 'data:image/jpeg;base64,' },
    { id: 15, name: 'Clopidogrel', price: 32, image: 'https://5.imimg.com/data5/SELLER/Default/2023/3/293106006/NJ/NS/EB/29765627/clopidogrel-75mg-aspirin-75mg-tab.jpg' },
];

export default function MedicineSearch({ onAddToCart }) {
    const [search, setSearch] = useState('');
    const [filteredMedicines, setFilteredMedicines] = useState(medicinesList);

    const handleSearch = (e) => {
        setSearch(e.target.value);
        setFilteredMedicines(
            medicinesList.filter((medicine) =>
                medicine.name.toLowerCase().includes(e.target.value.toLowerCase())
            )
        );
    };

    return (
        <div className="medicine-search">
            <h2 style={{color:'white'}}>Search for Medicines</h2>
            <input
                type="text"
                placeholder="Search Medicine"
                value={search}
                onChange={handleSearch}
                className="search-input"
            />
            <div className="medicine-grid">
                {filteredMedicines.map((medicine) => (
                    <div key={medicine.id} className="medicine-card">
                        <img src={medicine.image} alt={medicine.name} className="medicine-image" />
                        <div className="medicine-info">
                            <h3>{medicine.name}</h3>
                            <p>Price: ${medicine.price}</p>
                            <button onClick={() => onAddToCart(medicine)} className="add-to-cart-btn">
                                Add to Cart
                            </button>
                        </div>
                    </div>
                ))}
            </div>
        </div>
    );
}
